INSERT INTO `movie` (`id`, `duration`, `image`, `language`, `over_view`, `rating`, `release_date`, `title`, `trailer`) VALUES
(1, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/yh64qw9mgXBvlaWDi7Q9tpUBAvH.jpg', 'English', 'Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she s ever faced.', 8.5, '2024-11-01 07:11:39.000000', 'Moana 2', 'https://example.com/trailers/moana_2.mp4'),
(2, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/aosm8NMQ3UyoBVpSxyimorCQykC.jpg', 'en', 'Eddie and Venom are on the run. Hunted by both of their worlds and with the net closing in, the duo are forced into a devastating decision that will bring the curtains down on Venom and Eddie\'s last dance.', 6.4, '2024-10-22 00:00:00.000000', 'Venom: The Last Dance', 'https://example.com/trailers/venom_last_dance.mp4'),
(3, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/uQhYBxOVFU6s9agD49FnGHwJqG5.jpg', 'en', 'A single father and two women venture from the safety of their homes to face monstrous creatures to save the life of a young boy.', 6.3, '2024-11-07 00:00:00.000000', 'Elevation', 'https://example.com/trailers/elevation.mp4'),
(4, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/f8H9sLin46B7ka4DEqjemGuiCOB.jpg', 'en', 'Dallas, a burdened but headstrong dancer, is determined to get into the best dance school in the country—her late mother’s alma mater. However, that dream is suddenly derailed when the cheeky yet secretly grieving football star, Drayton, crashes into her life with a unique story of his own. Will the two of them be able to grow into their dreams together, or will their dreams be sidelined?', 6.7, '2024-11-29 00:00:00.000000', 'Sidelined: The QB and Me', 'https://example.com/trailers/sidelined_qb_and_me.mp4'),
(5, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/cNtAslrDhk1i3IOZ16vF7df6lMy.jpg', 'en', 'An aging ex-boxer gangster working as muscle for a Boston crime boss receives an upsetting diagnosis. Despite a faltering memory, he attempts to rectify the sins of his past and reconnect with his estranged children. He is determined to leave a positive legacy for his grandson, but the criminal underworld isn’t done with him and won’t loosen their grip willingly.', 6.126, '2024-10-31 00:00:00.000000', 'Absolution', 'https://example.com/trailers/absolution.mp4'),
(6, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/pnXLFioDeftqjlCVlRmXvIdMsdP.jpg', 'en', 'Armored truck security guard James Brody is working with his son Casey transporting millions of dollars between banks when a team of thieves led by Rook orchestrate a takeover of their truck to seize the riches. Following a violent car chase, Rook soon has the armored truck surrounded and James and Casey find themselves cornered onto a decrepit bridge.', 5.628, '2024-10-30 00:00:00.000000', 'Armor', 'https://example.com/trailers/armor.mp4'),
(7, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/m2hs6YPVrzjvRC21SE9BeXtgqFW.jpg', 'en', 'Suspicious of the events ensnaring their former colleagues, Nite Owl and Silk Spectre are spurred out of retirement to investigate. As they grapple with personal ethics, inner demons and a society turned against them, they race the clock to uncover a deepening plot that might trigger global nuclear war.', 7.5, '2024-11-25 00:00:00.000000', 'Watchmen: Chapter II', 'https://example.com/trailers/watchmen_chapter_ii.mp4'),
(8, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/2cxhvwyEwRlysAmRH4iodkvo0z5.jpg', 'en', 'Years after witnessing the death of the revered hero Maximus at the hands of his uncle, Lucius is forced to enter the Colosseum after his home is conquered by the tyrannical Emperors who now lead Rome with an iron fist. With rage in his heart and the future of the Empire at stake, Lucius must look to his past to find strength and honor to return the glory of Rome to its people.', 6.648, '2024-11-13 00:00:00.000000', 'Gladiator II', 'https://example.com/trailers/gladiator_ii.mp4'),
(9, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/wTnV3PCVW5O92JMrFvvrRcV39RU.jpg', 'en', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', 8.4, '2024-09-12 00:00:00.000000', 'The Wild Robot', 'https://example.com/trailers/wild_robot.mp4'),
(10, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/xDGbZ0JJ3mYaGKy4Nzd9Kph6M9L.jpg', 'en', 'In the land of Oz, ostracized and misunderstood green-skinned Elphaba is forced to share a room with the popular aristocrat Glinda at Shiz University, and the two\'s unlikely friendship is tested as they begin to fulfill their respective destinies as Glinda the Good and the Wicked Witch of the West.', 7.569, '2024-11-20 00:00:00.000000', 'Wicked', 'https://example.com/trailers/wicked.mp4'),
(11, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/ht8Uv9QPv9y7K0RvUyJIaXOZTfd.jpg', 'en', 'About to embark on a new world tour, global pop sensation Skye Riley begins experiencing increasingly terrifying and inexplicable events. Overwhelmed by the escalating horrors and the pressures of fame, Skye is forced to face her dark past to regain control of her life before it spirals out of control.', 6.6, '2024-10-16 00:00:00.000000', 'Smile 2', 'https://example.com/trailers/smile_2.mp4'),
(12, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/ju10W5gl3PPK3b7TjEmVOZap51I.jpg', 'en', 'Five years after surviving Art the Clown\'s Halloween massacre, Sienna and Jonathan are still struggling to rebuild their shattered lives. As the holiday season approaches, they try to embrace the Christmas spirit and leave the horrors of the past behind. But just when they think they\'re safe, Art returns, determined to turn their holiday cheer into a new nightmare. The festive season quickly unravels as Art unleashes his twisted brand of terror, proving that no holiday is safe.', 6.862, '2024-10-09 00:00:00.000000', 'Terrifier 3', 'https://example.com/trailers/terrifier_3.mp4'),
(13, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/cdqLnri3NEGcmfnqwk2TSIYtddg.jpg', 'en', 'After Santa Claus (codename: Red One) is kidnapped, the North Pole\'s Head of Security must team up with the world\'s most infamous bounty hunter in a globe-trotting, action-packed mission to save Christmas.', 6.6, '2024-10-31 00:00:00.000000', 'Red One', 'https://example.com/trailers/red_one.mp4'),
(14, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/bx92hl70NUhojjO3eV6LqKllj4L.jpg', 'fr', 'When a notorious gang of bikers recruits her brother for a heist, a former motocross champion must face her deepest fears to keep her family safe.', 6.008, '2024-11-19 00:00:00.000000', 'GTMAX', 'https://example.com/trailers/gtmax.mp4'),
(15, '120', 'https://www.themoviedb.org/t/p/w220_and_h330_face/lqoMzCcZYEFK729d6qzt349fB4o.jpg', 'en', 'A fading celebrity decides to use a black market drug, a cell-replicating substance that temporarily creates a younger, better version of herself. But things go horribly wrong when she starts to lose control over her younger self.', 6.4, '2024-11-12 00:00:00.000000', 'Rejuvenate', 'https://example.com/trailers/rejuvenate.mp4'),
(16, '142', 'https://image.tmdb.org/t/p/w500/9cqNxx0GxF0bflZmeSMuL5tnGzr.jpg', 'English', 'Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', 8.708, '1994-09-23 00:00:00.000000', 'The Shawshank Redemption', 'https://example.com/trailers/shawshank.mp4'),
(17, '175', 'https://image.tmdb.org/t/p/w500/3bhkrj58Vtu7enYsRolD1fZdja1.jpg', 'English', 'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', 8.69, '1972-03-14 00:00:00.000000', 'The Godfather', 'https://example.com/trailers/godfather.mp4'),
(18, '202', 'https://image.tmdb.org/t/p/w500/hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg', 'English', 'In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.', 8.6, '1974-12-20 00:00:00.000000', 'The Godfather Part II', 'https://example.com/trailers/godfather2.mp4'),
(19, '195', 'https://image.tmdb.org/t/p/w500/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg', 'English', 'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.', 8.566, '1993-12-15 00:00:00.000000', 'Schindler\'s List', 'https://example.com/trailers/schindler.mp4'),
(20, '96', 'https://image.tmdb.org/t/p/w500/ow3wq89wM8qd5X7hWKxiRfsFf9C.jpg', 'English', 'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each other.', 8.5, '1957-04-10 00:00:00.000000', '12 Angry Men', 'https://example.com/trailers/angrymen.mp4'),
(21, '125', 'https://image.tmdb.org/t/p/w500/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg', 'Japanese', 'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', 8.5, '2001-07-20 00:00:00.000000', 'Spirited Away', 'https://example.com/trailers/spiritedaway.mp4'),
(22, '191', 'https://image.tmdb.org/t/p/w500/lfRkUr7DYdHldAqi3PwdQGBRBPM.jpg', 'Hindi', 'Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.', 8.5, '1995-10-20 00:00:00.000000', 'Dilwale Dulhania Le Jayenge', 'https://example.com/trailers/dilwale.mp4'),
(23, '152', 'https://image.tmdb.org/t/p/w500/qJ2tW6WMUDux911r6m7haRef0WH.jpg', 'English', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', 8.516, '2008-07-16 00:00:00.000000', 'The Dark Knight', 'https://example.com/trailers/darkknight.mp4'),
(24, '189', 'https://image.tmdb.org/t/p/w500/8VG8fDNiy50H4FedGwdSVUPoaJe.jpg', 'English', 'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cell block\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.', 8.5, '1999-12-10 00:00:00.000000', 'The Green Mile', 'https://example.com/trailers/greenmile.mp4'),
(25, '132', 'https://image.tmdb.org/t/p/w500/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg', 'Korean', 'All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.', 8.505, '2019-05-30 00:00:00.000000', 'Parasite', 'https://example.com/trailers/parasite.mp4'),
(26, '90', 'https://image.tmdb.org/t/p/w500/dzDMewC0Hwv01SROiWgKOi4iOc1.jpg', 'Latvian', 'A solitary cat, displaced by a great flood, finds refuge on a boat with various species and must navigate the challenges of adapting to a transformed world together.', 8.496, '2024-08-29 00:00:00.000000', 'Flow', 'https://example.com/trailers/flow.mp4'),
(27, '154', 'https://image.tmdb.org/t/p/w500/d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg', 'English', 'A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.', 8.5, '1994-09-10 00:00:00.000000', 'Pulp Fiction', 'https://example.com/trailers/pulpfiction.mp4'),
(28, '106', 'https://image.tmdb.org/t/p/w500/vfJFJPepRKapMd5G2ro7klIRysq.jpg', 'Japanese', 'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki\'s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.', 8.485, '2016-08-26 00:00:00.000000', 'Your Name.', 'https://example.com/trailers/yourname.mp4'),
(29, '200', 'https://image.tmdb.org/t/p/w500/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg', 'English', 'As armies mass for a final battle that will decide the fate of the world--and powerful, ancient forces of Light and Dark compete to determine the outcome--one member of the Fellowship of the Ring is revealed as the noble heir to the throne of the Kings of Men. Yet, the sole hope for triumph over evil lies with a brave hobbit, Frodo, who, accompanied by his loyal friend Sam and the hideous, wretched Gollum, ventures deep into the very dark heart of Mordor on his seemingly impossible quest to destroy the Ring of Power.​', 8.482, '2003-12-17 00:00:00.000000', 'The Lord of the Rings: The Return of the King', 'https://example.com/trailers/returnoftheking.mp4'),
(30, '142', 'https://image.tmdb.org/t/p/w500/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg', 'English', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.', 8.4, '1994-07-06 00:00:00.000000', 'Forrest Gump', 'https://example.com/trailers/forrestgump.mp4');
